function App() {
  return (
    <div className="App">
      <header className="App-header">
              <h1>BSU In-Patient Nurse Staffing Simulator</h1>
                      <p class="lead">
                  Hospital unit is <input
                      type='text'
                      name='HospitalUnit'
                      
                  /> and HPPD is <input
                      type='text'
                      name='HPPD'

                  />. You census is <input
                      type='text'
                      name='CensusPercentage'

                  />% full in a <input
                      type='text'
                      name='BedUnit'

                  /> bed unit. Allocate you resources accordingly.
            </p>

            <button onclick="AtHomePractice()">At Home Practice</button>

      </header>
          <BudgetCalculator />
    </div>

  );
}

export default App;
